import { useEffect, useState } from "react";

const Home = () => {
    
    const [todos, setTodos] = useState(null);

    useEffect(()=>{
        const fetchTodos = async () =>{

            const response = await fetch('http://localhost:4000/api/todos');
            const json = await response.json();

            if(!response.ok){
                setTodos(json);
            }
        }

    },[])

    return(
        <div className="home">
            <div className="todos">
                {todos && todos.map((todo) =>(
                    <p>{todo}</p>
                ))}
            </div>
        </div>
    )
}

export default Home;
